<template>
  <div class="top-main-designer-wrapper" @scroll="handleScroll" ref="designerWrapper">
    <div id="mainDesignerWrapper"
         :class="designerWrapperLayout"
         class="main-designer-wrapper ">
      <navigation-bar ref="navigationBar"></navigation-bar>
      <main-designer ref="mainDesigner"></main-designer>
      <button-tab-bar :showScroll="showScroll" ref="buttonTabBar"></button-tab-bar>
    </div>
  </div>
</template>

<script>
import { mapGetters } from "vuex";
import ButtonTabBar from "@/components/MainDesignerArea/ButtonTabBar";
import NavigationBar from "@/components/MainDesignerArea/NavigationBar";
import MainDesigner from "@/components/MainDesignerArea/MainDesigner";

export default {
  name: 'main-designer-wrapper',
  components: {NavigationBar, MainDesigner, ButtonTabBar},
  data() {
    return {
      wrapper: '',
      showScroll: '',
    }
  },
  created() {
    window.addEventListener('scroll', this.handleScroll);
  },
  mounted() {
    this.wrapper = this.$refs.designerWrapper;
    this.$store.commit('ADD_ITEM', this.$refs.mainDesigner);
  },
  methods: {
    handleScroll() {
      if (this.wrapper.clientHeight + this.wrapper.scrollTop >= this.wrapper.scrollHeight) {
        this.showScroll = '';
      } else if (this.wrapper.clientHeight + this.wrapper.scrollTop < this.wrapper.scrollHeight){
        this.showScroll = 'scroll';
      }
    },
  },
  computed: {
    ...mapGetters({
      designerWrapperLayout: "getWrapperSize"
    })
  },
  destroyed() {
    window.removeEventListener('scroll', this.handleScroll);
  }
}
</script>

